from befree.api_model.config.headers import Headersfrom befree.api_model.config.private.default.endpoints import Endpointsfrom befree.api_model.config.private.default.payloads import Payloadsfrom befree.api_model import apifrom requests import Responseclass Default:    def __init__(self):        self._endpoints = Endpoints()        self._payloads = Payloads()        self._headers = Headers()    def update(self, configs=[]):        response: Response = api.config_private_session.post(            url=self._endpoints.update_config,            data=self._payloads.update_config(configs=configs),            headers=self._headers.common,        )        return response    def update_single(self, title, key, value, **kwargs):        response: Response = api.config_private_session.post(            url=self._endpoints.update_config,            data=self._payloads.update_single(title=title, key=key, value=value, **kwargs),            headers=self._headers.common,        )        return response    def update_root(self, root, configs):        response: Response = api.config_private_session.post(            url=self._endpoints.update_config,            data=self._payloads.update_root(root=root, configs=configs),            headers=self._headers.common,        )        return response